import './Container.css';
// 배너 이미지 import
import banner1 from 'https://cdn.inflearn.com/public/main_sliders/2919d23b-45c5-416d-9684-384b08415109/%5B%EC%9D%B4%EB%B2%A4%ED%8A%B8%5D%EC%B0%BD%EB%A6%BD%EA%B8%B0%EB%85%90%EC%9D%BC_7th_521.png';
import banner2 from 'https://cdn.inflearn.com/public/main_sliders/5207c5ee-e72f-4fc1-aad0-6122d2a55956/%5B%E1%84%86%E1%85%A6%E1%84%8B%E1%85%B5%E1%86%AB%E1%84%92%E1%85%B5%E1%84%8B%E1%85%A5%E1%84%85%E1%85%A9%5D%E1%84%85%E1%85%A9%E1%84%83%E1%85%B3%E1%84%86%E1%85%A2%E1%86%B8%E1%84%8B%E1%85%B5%E1%86%B8%E1%84%86%E1%85%AE%E1%86%AB_main_521.gif';
import banner3 from "https://cdn.inflearn.com/public/main_sliders/59b1ab15-c8e6-47a6-b08f-9329cb1e4657/%5BGrepp%5D%E1%84%8B%E1%85%B0%E1%86%B8%E1%84%83%E1%85%A6%E1%84%87%E1%85%B3%E1%84%8F%E1%85%A9%E1%84%89%E1%85%B3_main_521.png";

function Container() {
    return(
        <div className="container">
            <div>
                <banner1/>
            </div>
        </div>
    );
};

export default Container;
